import React, { useEffect } from 'react';
import moment from 'moment';
import { Form } from 'react-bootstrap';

import './delivery.styles.scss';

const DeliveryPage = () => {
    const currentMoment = moment().subtract(4, 'days');

    const dateArrayFunc = (event) => {
        console.log(typeof currentMoment)
    }


    return (

        <div className="container">
            <div className="row">
                <div className="col-3"></div>
                <div className="col-6 delivery-page">
                    <h2 className="delivery-slot">Delivery Slot</h2>
                    <button onClick={dateArrayFunc}>click me</button>
                    <Form className="date-picker">
                        <Form.Group controlId="exampleForm.SelectCustomSizeSm">
                            <Form.Label>Custom select Small</Form.Label>
                            <Form.Control as="select" size="sm" custom>
                            <option>{currentMoment.format('dddd, MMMM Do YYYY')}</option>
                            </Form.Control>
                        </Form.Group>
                    </Form>
                </div>
                <div className="col-3"></div>
            </div>
        </div>
    )
}

export default DeliveryPage;
